// import './App.css';
import { Menu, RightSection } from './Components';
// import { Route, Routes } from 'react-router-dom';
import { Routes, Route, Navigate } from 'react-router-dom';
import LeaveRightSection from './Components/RightSection/leaveRightSection'
import Attendence from './Components/RightSection/Attendence';
import Login from './Components/Login';
import Signup from './Components/Signup';
import Shifter from './Components/Shifter';
const express = require('express');
const cors = require('cors');
const app = express();

// Enable CORS for all routes
app.use(cors());

// Your routes and other server logic...

app.listen(5066, () => {
  console.log('Server is running on http://127.0.0.1:5066');
});

function App() {
    return (
        <>
            <Routes>
                <Route path="/" element={<Navigate to="/login" />} />
                <Route path="/login" element={<Login />} />
                <Route path="/signup" element={<Signup />} />
                <Route path="/attendence" element={<Attendence />} />
                <Route path="/leave" element={<LeaveRightSection />} />
            </Routes>
        </>

    );
}

export default App;
